import React from "react";
//import Grid from '@material-ui/core/Grid';

const CurrentlyViewing = (props) => {
    return (
        <div className="current_view_wrapper">

            <p>  See @{props.name}'s feed below</p>

        </div>
    )
}

export default CurrentlyViewing;
